var entityStr = ""

func TestEntity_HandleEntity(t *testing.T) {
	v := &v1.ProtoEvent{}
	err := json.Unmarshal([]byte(event), v)
	t.Log(err)
	vd := &v1.ProtoEvent_Patches{}
	err = json.Unmarshal([]byte(eventData), vd)
	t.Log(err)
	v.Data = vd

	bytes, err := base64.StdEncoding.DecodeString(entityStr)
	t.Log(err)
	e, err := NewEntity("iotd-e130acba-1fd5-4e4f-8b51-5824d930e19f", bytes)
	t.Log(err)

	ret := handleEntity(v, e)
	t.Log(ret)
}

func handleEntity(event v1.PatchEvent, entity Entity) *Feed {
	ctx := context.Background()
	r := &Runtime{}
	execer := &Execer{
		state: entity,
		preFuncs: []Handler{
			&handlerImpl{fn: r.handleRawData},
		}, //  Patches
		execFunc: entity,
		postFuncs: []Handler{
			&handlerImpl{fn: r.handleTentacle}, // 
			&handlerImpl{fn: r.handleComputed}, // 
			//&handlerImpl{fn: r.handlePersistent}, // 
			//&handlerImpl{fn: r.handleSubscribe}, //
			//&handlerImpl{fn: r.handleTemplate},
		},
	}
	feed := &Feed{
		Err:      nil,
		Event:    event,
		State:    entity.Raw(),
		EntityID: entity.ID(),
		Patches:  conv(event.Patches()),
	}
	return execer.Exec(ctx, feed)
}
